import React from 'react';

import 'semantic-ui-css/semantic.min.css';
import Login from './Login'

import { NavLink} from 'react-router-dom';



class App extends React.Component{

  constructor(){
    super()
    this.state = {
      testNew: "testnew",
      test: "test",
      form: false,
      user: {}
    }
  }


  render(){

    return (
    <div>
      <Login/>
      <br></br>
      <NavLink
        to="/signup"
        exact

        activeStyle={{
            background: 'darkblue'
        }}
        > Signup
      </NavLink>
    </div>

  )};

}

export default App;
